import React from "react";
import "./index.css";
import ProgressContextProvider from "./contexts/ProgressContext";
import ProgressBar from "./components/Header/progressbar";

function App() {
  return (
    <div className="App">
      <ProgressContextProvider>
        <ProgressBar />
      </ProgressContextProvider>
    </div>
  );
}

export default App;
